import React from 'react';
import './facerecognition.css';

const Facerecognition = (props) => {
    const {imageUrl, box} = props;

    return (
        <div className='center mt3 relative'>
            <div>
                <img id='imageInput' src={imageUrl} alt='' style={{width: '500px', height: 'auto'}} onLoad={() => {
                    const imageInput = document.getElementById("imageInput");
                    const width = Number(imageInput.width);
                    const height = Number(imageInput.height);
                }} />
            </div>  
            <div className='bounding-box' style={{
                top: box.topRow, 
                left: box.leftCol, 
                width: box.rightCol - box.leftCol, 
                height: box.bottomRow - box.topRow
            }}></div>
        </div>
    )
}

export default Facerecognition;
